import React from "react";
import SelectLang from "../components/GetStarted/SelectLang";
import SingInBtn from "../components/GetStarted/SingInBtn";
import NetflixLogo from "../components/NetflixLogo";
import backImg from "../assets/begin-page/header-img.jpg";

const GetStarted = () => {
  return (
    <div>
      <nav className="flex justify-between items-center px-14 pt-7">
        <NetflixLogo />
        <div className="lang-signin">
          <SelectLang />
          <SingInBtn />
        </div>
      </nav>
      <header className="absolute left-0">
        <img src={backImg} alt="" className="absolute" />
      </header>
    </div>
  );
};

export default GetStarted;
